import React from "react";

class Navbar extends React.Component {
  render() {
    return (
      <div>
        <img
          src="./assets/logo/Logo-brainflix.svg"
          alt="this is the Brainflix logo"
        />
        This is my navbar
      </div>
    );
  }
}

export default Navbar;
